    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Nomans Land Island NWR for the next 15 years.
    This plan outlines the Refuge vision and purpose and describes how Nomans Land Island
    NWR will contribute to the overall mission of the Refuge System. The plan provides
    an introduction to the Refuge, an overview of the CCP process, a summary of Refuge
    resources, information about the management direction, strategies for implementation,
    and consultation with others. Key planning issues include: wildlife management,
    habitat management, public use, cultural resources, tribal relations, and wilderness
